import React, { useState } from 'react';

function Header() {
  const [selectedLink, setSelectedLink] = useState('home');

  const handleLinkClick = (link) => {
    setSelectedLink(link);
  };

  return (
    <nav>
      <ul>
        <li className={selectedLink === 'home' ? 'active' : ''}>
          <a href="#" onClick={() => handleLinkClick('home')}>Home</a>
        </li>
        <li className={selectedLink === 'about' ? 'active' : ''}>
          <a href="#" onClick={() => handleLinkClick('about')}>About</a>
        </li>
        <li className={selectedLink === 'contact' ? 'active' : ''}>
          <a href="#" onClick={() => handleLinkClick('contact')}>Contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default Header;
